import React from 'react';
import './style.css';
import bg from '../../assets/imgs/Feliciano.png';
const Intro = () => {
  return (
    <section id="intro">
        <div className="content"></div>
        <img src={bg}></img>
    </section>
  )
}

export default Intro;
